// TODO: Remove this once https://github.com/denoland/deno/issues/3521
//       is fixed/ addressed.
const wasmBase64 = "";

function decodeBase64(base64) {
  const bytesStr = window.atob(base64);
  const bytes = new Uint8Array(bytesStr.length);
  for (let i = 0, c = bytesStr.length; i < c; i++) {
    bytes[i] = bytesStr.charCodeAt(i);
  }
  return bytes;
}

const { instance } = await WebAssembly.instantiate(decodeBase64(wasmBase64));
export default instance.exports;
